Una domenica di cordoglio ma, comunque, di NEWS DELLA SETTIMANA. Grazie, come sempre, di esserci e di supportarci.

INDICE DELLE #NEWS VIDEOGIOCHI:
0:00 - Intro;
0:16 - Inside Playerinside. Non lo hai letto solo tu;
0:43 - Lo SCANDALO di Leggende Pokémon Z-A e il "TeraLeak";
2:42 - GTA 6 potrebbe costare 100 euro in effetti, ma...;
3:42 - Dead Space 4: l'autore originale lo farebbe;
4:19 - Bloodborne remake in arrivo a cura di Bluepoint Studios?
5:13 - Un indizio per una nuova PSP (PlayStation Portatile)?
5:54 - Nintendo Switch 2: le vendite vanno molto bene;
6:15 - Xbox: Sarah Bond, il presidente, mostra che Microsoft sta lavorando alla prossima console;
7:08 - Microsoft e la ricerca di personale… particolare;
8:08 - Tencent, Sony e le accuse di plagio: una nuova telenovela?
9:14 - Hideo Kojima: i sequel, i remake e le remaster saranno realizzati al 100% dalle IA in futuro;
10:10 - Halo: quanto manca per le notizie sul prossimo capitolo?
11:15 - PlayStation Plus Extra e Premium: le novità di ottobre e novembre 2025;
11:30 - NEWS A RAFFICA;
13:53 - Saluti, blooper e un addio speciale

…
- Raiden & Midna

